import './App.css';


function App() {
  return (
    <>

    <br/>
    <form></form>
      Name :- 
      <input type='text' placeholder='Username'></input><br/>
      Email :- 
      <input type='email' placeholder='name@gamil.com'></input><br/>
      Mobile
      <input type='number' placeholder='(00) 12364789356'></input><br/>


    </> );
}

export default App;
